@use "colors.scss";

// TEXT

h1 {
  font-size: 40px;
}

h3 {
  font-size: 24px;
}

p {
  font-size: 20px;
}

// BUTTONS
button {
  background-color: white;
  border: none;
  outline: none;
  padding: 8px;
  margin: 4px;
  width: fit-content;
  min-width: 60px;
  border-radius: 8px;
  color: colors.$color-primary;
  font-size: 18px;
  font-weight: bold;
  cursor: pointer;
}

img.button {
  cursor: pointer;
}

.text-button {
  background-color: transparent;
  border: none;
  color: colors.$color-primary;
  min-width: unset;
  padding: 4px;
  margin: 0px;
}

.text-button:hover {
  text-decoration: underline;
}

input {
  border: none;
  border-radius: 2px;
  outline: none;

  background-color: colors.$color-bg-lightgray;
  color: colors.$color-text-primary;

  padding: 8px 12px;
  margin: 4px;

  font-size: 16px;
}

ul {
  padding-left: 0px;
  list-style-type: none;
  li {
    font-size: 16px;
    padding: 4px;
    padding-top: 0px;
  }
}

// custom classes
.icon {
  width: 24px;
  height: 24px;
  padding: 4px;
  margin: 4px;
  padding-top: 8px;
}

.top-bar {
  display: flex;
  flex-direction: row;

  justify-content: space-between;
  padding: 12px;

  color: colors.$color-white;
  background-color: colors.$color-primary-light;

  button {
    @extend .text-button;
    color: colors.$color-white;
    width: 50px;
    font-size: 14px;

    margin: 0px;
    margin-top: 4px;
  }
}

