@use "colors.scss";
@use "sizes.scss";
@import "classes.scss";

@import "pages";
@import "modals";
@import "components";

html {
  width: 100%;

  background-color: white;
  color: colors.$color-text-primary;

  font-family: -apple-system, BlinkMacSystemFont, sans-serif;
}

body {
  display: flex;
  flex-direction: column;
  height: 100%;
}

* {
  // touch-action: none;
  margin: 0;
  padding: 0;
  overflow: hidden;
}

h1,
h2,
h3,
h4,
h5,
h6,
p,
label {
  overflow: unset;
}

.main {
  flex: 1;
  overflow: hidden;

  @media (max-width: sizes.$tablet) {
    width: 100%;
  }

  @media (min-width: sizes.$tablet) {
    width: 600px;
    margin-left: auto;
    margin-right: auto;
    border-left: 1px solid colors.$color-lightgray;
    border-right: 1px solid colors.$color-lightgray;
  }
}

.page {
  display: none;

  width: 100%;
  height: 100%;
}

.page.active {
  display: block;
}

.modal {
  position: fixed;
  width: 100%;
  height: 100%;
  z-index: 2;

  display: none;

  background-color: colors.$color-white;

  @media (min-width: sizes.$tablet) {
    background-color: colors.$color-bg-transparent;
  }

  .container {
    width: 100%;
    justify-self: flex-start;

    @media (min-width: sizes.$tablet) {
      width: 500px;
      margin-bottom: 10%;
      background-color: colors.$color-white;
    }
  }
}

.modal.active {
  display: flex;
  flex-direction: column;
  align-items: center;

  @media (min-width: sizes.$tablet) {
    justify-content: center;
  }
}

.mobile {
  display: none;

  @media (max-width: sizes.$tablet) {
    display: block;
  }
}
